import axios from "axios";
import React from "react";
import User from "./User";

const Users = () => {
  const [users, setUsers] = React.useState([]);

  React.useEffect(() => {
    axios.get("/api/users").then((users) => setUsers(users.data));
  }, []);
  return (
    <>
      <div className="w-full bg-white-800">
        <section className="w-full mx-auto px-4 sm:px-6 lg:px-4 py-12">
          <div className="text-center pb-12">
            <h2 className="text-base font-bold text-indigo-600">
              Bienvenido a la comunidad de peliculas m√°s grande
            </h2>
            <h1 className="font-bold text-3xl md:text-4xl lg:text-5xl font-heading text-white">
              Estos son los usuarios disponibles
            </h1>
          </div>
          <div
            className="shadow-md rounded-md overflow-hidden text-center"
            style={{
              width: 300,
            }}
          >
            <div style={{}}></div>
          </div>
          {users.map((us, i) => {
            return <User key={i} user={us} />;
          })}
        </section>
      </div>
    </>
  );
};

export default Users;
